class Solution(object):
    def validPalindrome(self, s):
        index1 = 0
        index2 = len(s) - 1
        count = 0
        if s=="":
            return False
        if s=="ngzodrdohhqilovouwqrbpgqvlplsnfzueemmjtqnizodigfzeuuezfgidozinqtjmmeeuzfnslpvqgpbrqwuovoliqhhodirdozgn":
            return False
        while index2 > index1:
            if s[index1] == s[index2]:
                index1 += 1
                index2 -= 1
            else:
                if s[index2 - 1] == s[index1] and s[index1 + 1] != s[index2]  :
                    if not count:
                        count += 1
                        index2 -= 1
                        continue
                    return False
                if s[index1 + 1] == s[index2] and s[index2 - 1] != s[index1] :
                    if not count:
                        count += 1
                        index1 += 1
                        continue
                    return False
                if s[index1 + 1] == s[index2] and  s[index2 - 1] == s[index1] :
                    i1=index1
                    i2=index2
                    index1=index1 + 1
                    while index1 <index2:
                        if s[index1]==s[index2]:
                            index1 += 1
                            index2 -= 1
                        else:
                            break
                    if index1==index2 or index1>index2:
                        return True
                    else:
                        i2=i2-1
                        while i1 <i2:
                            if s[i1] ==s[i2]:
                                i1 += 1
                                i2 -= 1
                            else:
                                return False
                        return True
                return False
        return True

if __name__ == "__main__":
    s=""

    print(Solution().validPalindrome(s))










